function buildMarkerLines(series) {
    let shapes = [];
    for (let i = 0; i < series.length; i++) {
        let trace = series[i];
        let minX = Math.min.apply(null, trace['x']);
        let maxX = Math.max.apply(null, trace['x']);
        let max = Math.max.apply(null, trace['y']);
        let maxLine = {
            type: 'line',
            x0: minX,
            y0: max,
            x1: maxX,
            y1: max,
            line: {
                color: trace['line']['color'],
                width: 1,
                dash: 'dashdot'
            }
        };
        shapes.push(maxLine);
        let min = Math.min.apply(null, trace['y']);
        let minLine = {
            type: 'line',
            x0: minX,
            y0: min,
            x1: maxX,
            y1: min,
            line: {
                color: trace['line']['color'],
                width: 1,
                dash: 'dashdot'
            }
        };
        shapes.push(minLine);
        let mean = trace['y'].reduce((previous, current) => current += previous) / trace['y'].length;
        let meanLine = {
            type: 'line',
            x0: minX,
            y0: mean,
            x1: maxX,
            y1: mean,
            line: {
                color: trace['line']['color'],
                width: 1,
                dash: 'dashdot'
            }
        };
        shapes.push(meanLine);
        let yCopy = trace['y'].slice();
        yCopy.sort((a, b) => a - b);
        let median = (yCopy[(yCopy.length - 1) >> 1] + yCopy[yCopy.length >> 1]) / 2;
        let medianLine = {
            type: 'line',
            x0: minX,
            y0: median,
            x1: maxX,
            y1: median,
            line: {
                color: trace['line']['color'],
                width: 1,
                dash: 'dashdot'
            }
        };
        shapes.push(medianLine);
    }
    return shapes;
}


